import React from "react";

export default function AboutUs() {
  return (
    <>
    <div>
      <p>“THE MEMORY POWER” is an EdTech startup company that equips students with the skillset and mindset required to be the future of the companies worldwide. We connect a deep understanding of education with the power of the “21st CENTURY LIFE SKILLS” to make your child ready to face this competitive and challenging world.</p>
    <br /><br />
    <p>The universe is a subject created in the minds of humans addressed by the facts and theories since centuries. To think about it in detail requires the strength of knowledge and experience which are used to lead an intellectual life.</p>
    </div><br /><br /><br /><br /><br /><br />
    </>
  );
}
